import React, {Component} from 'react';
import {Navbar} from 'react-bootstrap';
import logo from './assets/anshor.space.png';

class Header extends Component{
  render(){
    return(
      <Navbar className="justify-content-between bg-bluegradient " variant="dark">
        <Navbar.Brand>
          <img
            src={logo}
            alt="anshor.space logo"
            className="align-top logo"
            />
        </Navbar.Brand>
        <div>
          <a className="white-nav" href="/">ABOUT</a>
          <a className="white-nav" href="/">SKILL</a>
          <a className="white-nav" href="/">PROJECT</a>
          <a className="white-nav" href="/">CONTACT</a>
        </div>
      </Navbar>
    );
  }
}

export default Header;
